import React from 'react';
import App from './App';
import ReactDOM from 'react-dom';
var Papa = require("papaparse");
Papa.SCRIPT_PATH = "./papaparse.js";

ReactDOM.render(
<App />, // appel le composant App décrit dans l'import 
document.getElementById('root') //se trouve dans index.html
);
